            {
            } 
            else
            {
                $this->cabecalho();
            } 
       } 
            if ($_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['proc_pdf'] || $_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['proc_pdf_vert'])
            {
            } 
            else
            {
       $nm_saida->saida("                  <TR>\r\n");
       $nm_saida->saida("                  <TD id='sc_grid_content' style='padding: 0px;' colspan=3>\r\n");
            } 
       $nm_saida->saida("    <table width='100%' cellspacing=0 cellpadding=0>\r\n");
       if (!$this->Proc_link_res && $_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['opcao'] != 'pdf' && !$_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['proc_pdf'] && $_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['opcao_print'] != 'print')
       { 
