                  $Lin_grid_add  = $this->grid_search_tag_ini($Cmp_grid, $Def_grid, $Seq_grid);
                  $NM_func_grid_add = "grid_search_" . $Cmp_grid;
                  $Lin_grid_add .= $this->$NM_func_grid_add($Seq_grid, 'S', $def['opc'], $def['val'], $nmgp_tab_label[$Cmp_grid]);
                  $Lin_grid_add .= $this->grid_search_tag_end();
                  $this->Ini->Arr_result['grid_search_add'][] = array ('field' => $cmp, 'tag' => NM_charset_to_utf8($Lin_grid_add));
                  $seq_search++;
               } 
           } 
           elseif (!$this->Proc_link_res) 
           { 
               $this->html_grid_search();
           } 
       } 
       $display_tag_interativ = "none";
       $descr_refin = "";
       if ($nmgrp_apl_opcao != "pdf" && $_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['opcao_print'] != 'print' && isset($_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['interativ_search']) && !empty($_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['interativ_search']))
       { 
           $display_tag_interativ = "";
           $descr_refin = "<div class='scGridFilterTagList'>";
           foreach ($_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['interativ_search'] as $fil => $dados_fil) {
               foreach ($dados_fil['lab'] as $lab_fil => $opcs_fil) {
                   foreach ($opcs_fil as $iopc => $cada_opc) {
                       $descr_refin .= "<div class='scGridFilterTagListItem'>";
                       $descr_refin .= "<img align='absmiddle' style=\"cursor: pointer; float:right; padding-left: 5px;\" src=\"" . $this->Ini->path_img_global . "/" . $this->Ini->refinedsearch_close . "\" border=\"0\" onclick=\"nm_proc_int_search('clear_opc','" . $dados_fil['tp_obj'] . "','" . $lab_fil . "','" . $fil . "', 'id_int_search_" . $fil . "', '" . $fil . "', '" . $dados_fil['val_sel'][$iopc] . "##@@" . $cada_opc . "', 'S')\"/>";
                       $descr_refin .= "<span class='scGridFilterTagListItemLabel'>";
                       $descr_refin .= $lab_fil . "<br>";
                       if ($dados_fil['tp_obj'] == 'bw') {
                           $descr_refin .= $opcs_fil[0] . " <=> " . $opcs_fil[1];
                       }
                       else {
                           $descr_refin .= $cada_opc;
                       }
                       $descr_refin .= "</span></div>&nbsp;&nbsp;";
                       if ($dados_fil['tp_obj'] == 'bw') {
                           break;
                       }
                   }
               }
           }
           $Cod_Btn = nmButtonOutput($this->arr_buttons, "bfilref_limpar", "nm_proc_int_clear_all();", "nm_proc_int_clear_all();", "app_int_search_all_cancel", "", "", "vertical-align: text-bottom;", "absmiddle", "", "0px", $this->Ini->path_botoes, "", "", "", "", "", "only_text", "text_right", "", "", "", "", "", "", "");
           $descr_refin .= $Cod_Btn; 
           $descr_refin .= "</div>";
       } 
       $nm_saida->saida("       <tr id=\"tr_descr_refin_search\" style=\"display:" . $display_tag_interativ . ";padding: 0px;text-align: left;\"><td><div id=\"div_descr_refin_search\"  class=\"scGridFilterTag\" style=\"text-align: left;\">\r\n");
       if ($_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['ajax_nav']) {
           $_SESSION['scriptcase']['saida_html'] = "";
       }
       if ($_SESSION['scriptcase']['proc_mobile']) {
           $nm_saida->saida("            <a onclick=\"refin_search_mobile();\" class='scGridFilterTagIconCol'><i class='icon_fa " . $this->Ini->scGridRefinedSearchCollapseFAIcon . "'></i></a>\r\n");
       }
       $nm_saida->saida("         " . $descr_refin . "\r\n");
       if ($_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['ajax_nav']) {
           $this->Ini->Arr_result['setValue'][] = array('field' => 'div_descr_refin_search', 'value' => NM_charset_to_utf8($_SESSION['scriptcase']['saida_html']));
           $this->Ini->Arr_result['setDisplay'][] = array('field' => 'tr_descr_refin_search', 'value' => $display_tag_interativ);
       }
       $nm_saida->saida("       </div></td></tr> \r\n");

       if (!$this->Proc_link_res && $nmgrp_apl_opcao != "pdf" && $_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['opcao_print'] != 'print')
       { 
           $_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['dyn_refresh'] = array();
           $this->html_dynamic_search();
       } 
       if (isset($_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['save_grid']))
       {
           $this->refresh_interativ_search();
       }
       unset ($_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['save_grid']);
       if (!$_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['pdf_res'] && (!isset($_GET['flash_graf']) || 'chart' != $_GET['flash_graf']))
       {
           $this->grid();
       }
       if ($nmgrp_apl_opcao != "pdf")
       { 
           $this->nmgp_barra_bot();
       } 
       if (!$this->Proc_link_res && $_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['opcao'] != 'pdf' && !$_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['proc_pdf'] && $_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['opcao_print'] != 'print')
       { 
       $nm_saida->saida("       </table>\r\n");
       $nm_saida->saida("      </TD>\r\n");
       $nm_saida->saida("     </TR>\r\n");
       } 
       $nm_saida->saida("   </table>\r\n");
       $nm_saida->saida("  </TD>\r\n");
       $nm_saida->saida(" </TR>\r\n");
    }
       if (strpos(" " . $this->Ini->SC_module_export, "resume") !== false)
       { 
           $Gera_res = true;
       } 
       else 
       { 
           $Gera_res = false;
       } 
       if (strpos(" " . $this->Ini->SC_module_export, "chart") !== false)
       { 
           $Gera_graf = true;
       } 
       else 
       { 
           $Gera_graf = false;
       } 
       if ($_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['print_all'] && empty($this->nm_grid_sem_reg) && ($Gera_res || $Gera_graf) && $_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['SC_Ind_Groupby'] != "sc_free_total")
       { 
           $this->Res->monta_html_ini_pdf();
           $this->Res->monta_resumo();
           $this->Res->monta_html_fim_pdf();
           if ($Gera_graf)
           {
               $this->grafico_pdf();
           }
       } 
       if ($_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['opcao'] == "pdf" && $_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['SC_Ind_Groupby'] != "sc_free_total")
       { 
           if (isset($_GET['flash_graf']) && 'chart' == $_GET['flash_graf'])
           {
               $this->Res->monta_resumo(true);
               require_once($this->Ini->path_aplicacao . $this->Ini->Apl_grafico); 
               $this->Graf  = new resumen_procedimiento_grafico();
               $this->Graf->Db     = $this->Db;
               $this->Graf->Erro   = $this->Erro;
               $this->Graf->Ini    = $this->Ini;
               $this->Graf->Lookup = $this->Lookup;
               $this->Graf->monta_grafico();
               exit;
           }
           elseif ($Gera_res || $Gera_graf)
           {
               $this->Res->monta_html_ini_pdf();
               $this->Res->monta_resumo();
               $this->Res->monta_html_fim_pdf();
           }
       } 
       $flag_apaga_pdf_log = TRUE;
       if (!$this->Print_All && $_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['opcao'] == "pdf")
       { 
           $flag_apaga_pdf_log = FALSE;
       } 
       $this->nm_fim_grid($flag_apaga_pdf_log);
       if (!$this->Print_All && $_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['opcao'] == "pdf")
       { 
           $_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['opcao'] = "igual";
       } 
   }
   if ($_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['opcao_print'] == "print")
   {
       $_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['opcao'] = $_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['opcao_ant'];
       $_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['opcao_print'] = "";
   }
   $_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['opcao_ant'] = $_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['opcao'];
 }
 function resume($linhas = 0)
 {
    $this->Lin_impressas = 0;
    $this->Lin_final     = FALSE;
    $this->grid($linhas);
 }
