    function scGetColumnOrderRule($fieldName)
    {
        $sortRule = 'nosort';
        if ($_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['ordem_cmp'] == $fieldName) {
            if ($_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['ordem_label'] == 'desc') {
                $sortRule = 'desc';
            } else {
                $sortRule = 'asc';
            }
        }
        return $sortRule;
    }

    function scGetColumnOrderIcon($fieldName, $sortRule, $skipUnusedClass = false)
    {
        $unusedClass = $skipUnusedClass ? '' : ' sc-grid-order-icon-unused';        if ('desc' == $sortRule) {
            return "<img src=\"" . $this->Ini->path_img_global . "/" . $this->Ini->Label_sort_desc . "\" />";
        } elseif ('asc' == $sortRule) {
            return "<img src=\"" . $this->Ini->path_img_global . "/" . $this->Ini->Label_sort_asc . "\" />";
        } elseif ('' != $this->Ini->Label_sort) {
            return "<img src=\"" . $this->Ini->path_img_global . "/" . $this->Ini->Label_sort . "\" />";
        } else {
            return '';
        }
    }

    function scIsFieldNumeric($fieldName)
    {
        switch ($fieldName) {
            case "procedimiento_id_procedimiento":
                return true;
            case "procedimiento_edad":
                return true;
            case "barrio_id_barrio":
                return true;
            case "barrio_id_sector":
                return true;
            case "eps_id_eps":
                return true;
            case "procedimiento_id_barrio":
                return true;
            case "procedimiento_id_seguridad_social":
                return true;
            case "procedimiento_id_eps":
                return true;
            case "sector_id_sector":
                return true;
            case "seguridad_id_seguridad_social":
                return true;
            case "medico_id_medico":
                return true;
            case "ambulancia_id_movil":
                return true;
        }
        return false;
    }

