            if (isset($_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['print_navigator']) && $_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['print_navigator'] == "Netscape")
