   function html_dynamic_search()
   {
       global $nm_saida;
       $this->Dyn_search_seq = 0;
       $this->Dyn_search_str = "";
       $this->Dyn_search_dat = array();
       $this->NM_case_insensitive = false;
       if (isset($_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['cond_dyn_search']) && !empty($_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['cond_dyn_search']))
       {
           $tmp = $_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['cond_dyn_search'];
           $pos = strrpos($tmp, "##*@@");
           if ($pos !== false)
           {
               $and_or = (substr($tmp, ($pos + 5)) == "and") ? $this->Ini->Nm_lang['lang_srch_and_cond'] : $this->Ini->Nm_lang['lang_srch_orr_cond'];
               $tmp    = substr($tmp, 0, $pos);
               $this->Dyn_search_str = str_replace("##*@@", " " . $and_or . " ", $tmp);
           }
