   function dynamic_search_procedimiento_tipo_servicio($ind, $ajax, $opc="", $val=array(), $enabled = 'S')
   {
       $lin_obj  = "";
       $_classAlign = '';
       if (empty($opc))
       {
           $opc = "qp";
       }
       if ($opc == 'bw')
       {
           $_classAlign = 'alignTop';
       }
       $lin_obj .= "     <div id='dyn_search_procedimiento_tipo_servicio_" . $ind . "' class='align " . $_classAlign . " " . ($enabled=='S'?'':'disabled') . "'>";
       $lin_obj .= "      <i class='fa-solid fa-grip-lines-vertical drag_handle'></i>";
       $lin_obj .= "      <div class='fixed_width_select'>";
       $lin_obj .= "       <div class='width-constrain' style='display: '>";
       $lin_obj .= "         " . $_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['dyn_search_label']['procedimiento_tipo_servicio'] . " ";
       $lin_obj .= "       </div>";
       $lin_obj .= "      </div >";
       $lin_obj .= "      <div class='fixed_width_conditions '>";
       $lin_obj .= "       <select id='dyn_search_procedimiento_tipo_servicio_cond_" . $ind . "' name='cond_dyn_search_procedimiento_tipo_servicio_" . $ind . "' class=' " . $this->css_scAppDivToolbarInput . " css_toolbar_obj' style='vertical-align: middle;' onChange='buttonEnable_dyn(\"dyn_search\");dyn_search_hide_input(\"procedimiento_tipo_servicio\", $ind)'>";
       $selected = ($opc == "qp") ? " selected" : "";
       $lin_obj .= "        <option value='qp'" . $selected . ">" . $this->Ini->Nm_lang['lang_srch_like'] . "</option>";
       $selected = ($opc == "np") ? " selected" : "";
       $lin_obj .= "        <option value='np'" . $selected . ">" . $this->Ini->Nm_lang['lang_srch_not_like'] . "</option>";
       $selected = ($opc == "eq") ? " selected" : "";
       $lin_obj .= "        <option value='eq'" . $selected . ">" . $this->Ini->Nm_lang['lang_srch_exac'] . "</option>";
       $selected = ($opc == "ep") ? " selected" : "";
       $lin_obj .= "        <option value='ep'" . $selected . ">" . $this->Ini->Nm_lang['lang_srch_empty'] . "</option>";
       $lin_obj .= "       </select>";
       $lin_obj .= "      </div>";
       $display_in_1 = "''";
       if ($opc == "nu" || $opc == "nn" || $opc == "ep" || $opc == "ne")
       {
           $display_in_1 = "none";
       }
       $lin_obj .= "      <div class='fixed_width_input  fixed_width_input100'>";
       $lin_obj .= "        <span class='fixed_width_input_content' style='display:" . $display_in_1 . "'>";
       $val_cmp = (isset($val[0][0])) ? $val[0][0] : "";
       $procedimiento_tipo_servicio = $val_cmp;
       if ($procedimiento_tipo_servicio != "")
       {
       $procedimiento_tipo_servicio_look = (is_string($procedimiento_tipo_servicio) ? substr($this->Db->qstr($procedimiento_tipo_servicio), 1, -1) : $procedimiento_tipo_servicio); 
       $nmgp_def_dados = array(); 
       $nm_comando = "select distinct procedimiento.tipo_servicio from " . $this->Ini->nm_tabela . " where procedimiento.tipo_servicio = '$procedimiento_tipo_servicio_look' order by procedimiento.tipo_servicio"; 
       $_SESSION['scriptcase']['sc_sql_ult_comando'] = $nm_comando; 
       $_SESSION['scriptcase']['sc_sql_ult_conexao'] = ''; 
      if ($rs = $this->Db->SelectLimit($nm_comando, 10, 0)) 
       { 
          while (!$rs->EOF) 
          { 
            $cmp1 = trim($rs->fields[0]);
            $nmgp_def_dados[] = array($cmp1 => $cmp1); 
             $rs->MoveNext(); 
          } 
          $rs->Close(); 
       } 
       else  
       {  
           if  ($ajax == 'N')
           {  
              $this->Erro->mensagem (__FILE__, __LINE__, "banco", $this->Ini->Nm_lang['lang_errm_dber'], $this->Db->ErrorMsg()); 
              exit; 
           } 
           else
           {  
              echo $this->Db->ErrorMsg(); 
           } 
       } 
       }
       if (isset($nmgp_def_dados[0][$procedimiento_tipo_servicio]))
       {
           $sAutocompValue = $nmgp_def_dados[0][$procedimiento_tipo_servicio];
       }
       else
       {
           $sAutocompValue = $val_cmp;
           if(!is_array($val[0])) $val[0] = array();
           $val[0][0]      = $val_cmp;
       }
       $val_cmp = (isset($val[0][0])) ? $val[0][0] : "";
       $lin_obj .= "     <input  type=\"text\" class='sc-js-input " . $this->css_scAppDivToolbarInput . " css_toolbar_obj' id='dyn_search_procedimiento_tipo_servicio_val_" . $ind . "' name='val_dyn_search_procedimiento_tipo_servicio_" . $ind . "' onChange=\"buttonEnable_dyn('dyn_search'); buttonDisable_dyn('Save_frm_dyn'); buttonDisable_dyn('SC_nmgp_save_name_dyn');\" value=\"" . NM_encode_input($val_cmp) . "\" size=50 alt=\"{datatype: 'text', maxLength: 750, allowedChars: '', lettersCase: '', autoTab: false, enterTab: false}\" style='display: none' >";
       $lin_obj .= "     <input class='sc-js-input " . $this->css_scAppDivToolbarInput . " css_toolbar_obj' type='text' id='id_ac_procedimiento_tipo_servicio" . $ind . "' name='val_dyn_search_procedimiento_tipo_servicio_autocomp" . $ind . "' size='50' value='" . NM_encode_input($sAutocompValue) . "' alt=\"{datatype: 'text', maxLength: 50, allowedChars: '', lettersCase: '', autoTab: false, enterTab: false}\"  onChange=\"buttonEnable_dyn('dyn_search');buttonDisable_dyn('Save_frm_dyn');buttonDisable_dyn('SC_nmgp_save_name_dyn');\">";
       $lin_obj .= "        </span>";
       $lin_obj .= "      </div>";
       $lin_obj .= "       <div class='fixed_width_toolbar'>";
       $lin_obj .= "       <img class='dyn_search_field_close' style='cursor:pointer' id='dyn_search_procedimiento_tipo_servicio_close_" . $ind . "' class='dyn_search_close' title='". $this->Ini->Nm_lang['lang_usr_lang_del'] ."' src='" . $this->Ini->path_botoes . "/" . $this->Ini->Img_qs_clean . "' onclick=\"del_dyn_search('dyn_search_procedimiento_tipo_servicio_" . $ind . "', " . $ind . ", 'only');buttonEnable_dyn('dyn_search');buttonDisable_dyn('Save_frm_dyn');buttonDisable_dyn('SC_nmgp_save_name_dyn');\">";
       $enabled = 'S';
       $lin_obj .= "         <input type='hidden' class='dyn_search_enabled' name='dyn_search_enabled_procedimiento_tipo_servicio_" . $ind . "'  id='dyn_search_enabled_procedimiento_tipo_servicio_" . $ind . "' value='" . $enabled . "' />";
       $lin_obj .= "       </div>";
       $lin_obj .= "     </div>";
       if ($opc == "nu" || $opc == "nn" || $opc == "ep" || $opc == "ne") {
           $lin_obj .= "     <script>";
           $lin_obj .= "        $( document ).ready(function() {buttonEnable_dyn('dyn_search');});";
           $lin_obj .= "     </script>";
       }
       return $lin_obj;
   }
