                       $this->Dyn_search_seq++;
                       $this->Dyn_search_dat[$this->Dyn_search_seq] = "procedimiento_documento_identidad";
                       $str_filhos .= $this->dynamic_search_procedimiento_documento_identidad($this->Dyn_search_seq, 'N', $def['opc'], $def['val'], $chield['enabled']);
                   }
               }
               $str_filhos .= '</li>';
