   function grid_search_add_tag()
   {
       $lin_obj  = "";
       $All_cmp_search = array('barrio_id_barrio','barrio_barrio','barrio_id_sector','eps_id_eps');
       $nmgp_tab_label = $_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['pesq_tab_label'];
       if (!empty($nmgp_tab_label))
       {
          $nm_tab_campos = explode("?@?", $nmgp_tab_label);
          $nmgp_tab_label = array();
          foreach ($nm_tab_campos as $cada_campo)
          {
              $parte_campo = explode("?#?", $cada_campo);
              $nmgp_tab_label[$parte_campo[0]] = $parte_campo[1];
          }
       }
       if (isset($_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['grid_pesq']) && count($_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['grid_pesq']) < 4)
       {
           $lin_obj .= "<table id='id_grid_search_all_cmp' cellpadding=0 cellspacing=0>";
           foreach ($All_cmp_search as $cada_cmp)
           {
               if (!isset($_SESSION['sc_session'][$this->Ini->sc_page]['resumen_procedimiento']['grid_pesq'][$cada_cmp]))
               {
                   $lin_obj .= "  <tr>";
