   function lookup_ajax_barrio_barrio($barrio_barrio)
   {
       $barrio_barrio = substr($this->Db->qstr($barrio_barrio), 1, -1);
       $this->NM_case_insensitive = false;
       $barrio_barrio_look = (is_string($barrio_barrio) ? substr($this->Db->qstr($barrio_barrio), 1, -1) : $barrio_barrio); 
       $nmgp_def_dados = array(); 
       $nm_comando = "select distinct barrio.barrio from " . $this->Ini->nm_tabela . " where  barrio.barrio like '%" . $barrio_barrio . "%' order by barrio.barrio"; 
       $_SESSION['scriptcase']['sc_sql_ult_comando'] = $nm_comando; 
       $_SESSION['scriptcase']['sc_sql_ult_conexao'] = ''; 
      if ($rs = $this->Db->SelectLimit($nm_comando, 10, 0)) 
       { 
          while (!$rs->EOF) 
          { 
            $cmp1 = NM_charset_to_utf8(trim($rs->fields[0]));
            $cmp1 = resumen_procedimiento_pack_protect_string($cmp1);
            $nmgp_def_dados[] = array($cmp1 => $cmp1); 
             $rs->MoveNext(); 
          } 
          $rs->Close(); 
          return $nmgp_def_dados; 
       } 
       else  
       {  
          echo $this->Db->ErrorMsg(); 
       } 
   }
   function gera_array_filtros()
   {
       $this->NM_fil_ant = array();
       $pos_path = strrpos($this->Ini->path_prod, "/");
       $this->NM_path_filter = $this->Ini->root . substr($this->Ini->path_prod, 0, $pos_path) . "/conf/filters/";
       $NM_patch   = "CRUE/resumen_procedimiento";
       if (is_dir($this->NM_path_filter . $NM_patch))
       {
           $NM_dir = @opendir($this->NM_path_filter . $NM_patch);
           while (FALSE !== ($NM_arq = @readdir($NM_dir)))
           {
             if (@is_file($this->NM_path_filter . $NM_patch . "/" . $NM_arq))
             {
                 $Sc_v6 = false;
                 $NMcmp_filter = file($this->NM_path_filter . $NM_patch . "/" . $NM_arq);
                 $NMcmp_filter = explode("@NMF@", $NMcmp_filter[0]);
                 if (substr($NMcmp_filter[0], 0, 6) == "SC_V6_" || substr($NMcmp_filter[0], 0, 6) == "SC_V8_")
                 {
                     $Name_filter = substr($NMcmp_filter[0], 6);
                     if (!empty($Name_filter))
                     {
                         $this->NM_fil_ant[$NM_arq][0] = $NM_patch . "/" . $NM_arq;
                         $this->NM_fil_ant[$NM_arq][1] = "" . $this->Ini->Nm_lang['lang_srch_public']  . "";
                         $Sc_v6 = true;
                     }
                 }
                 if (!$Sc_v6)
                 {
                     $this->NM_fil_ant[$NM_arq][0] = $NM_arq;
                     $this->NM_fil_ant[$NM_arq][1] = "" . $this->Ini->Nm_lang['lang_srch_public']  . "";
                 }
                 if (!$Sc_v6 && count($NMcmp_filter) == 1)
                 {
                     $_arr_new = file_get_contents($this->NM_path_filter . $NM_patch . "/" . $NM_arq);
                     if(!empty($_arr_new) && substr($_arr_new, 0, 2)=='a:')
                     {
                         $_arr_new = unserialize($_arr_new);
                         $this->NM_fil_ant[$NM_arq][2] = $_arr_new['name'];
                     }
                 }
                 else
                 {
                     $this->NM_fil_ant[$NM_arq][2] = $Name_filter;
                 }
                 $this->NM_fil_ant[$NM_arq][3] = $this->NM_path_filter . $NM_patch . "/" . $NM_arq;
             }
           }
       }
       return $this->NM_fil_ant;
   }
